        "rek_formatted_title_xsdmf_id": 11438,
        "rek_formatted_title": "Increased genetic vulnerability to smoking at <em>CHRNA5 <\/em>in early-onset smokers",
        "rek_formatted_abstract_xsdmf_id": 11442,
        "rek_formatted_abstract": "<strong>Context:<\/strong> Recent studies have shown an association between cigarettes per day (CPD) and a nonsynonymous single-nucleotide polymorphism in <em>CHRNA5<\/em>, rs16969968. <br \/><strong>Objective:<\/strong> To determine whether the association between rs16969968 and smoking is modified by age at onset of regular smoking.<strong> <br \/>Data Sources:<\/strong> Primary data. <br \/><strong>Study Selection:<\/strong> Available genetic studies containing measures of CPD and the genotype of rs16969968 or its proxy. <br \/><strong>Data Extraction:<\/strong> Uniform statistical analysis scripts were runlocally. Startingwith94 050ever-smokersfrom43studies, we extracted the heavy smokers (CPD&gt;20) and light smokers (CPD &le;10) with age-at-onset information, reducing the sample size to 33 348. Each study was stratified into early-onset smokers (age at onset &le;16 years) and late-onset smokers (age at onset &gt;16 years), and a logistic regression of heavyvs light smoking with the rs16969968 genotype was computed for each stratum. Meta-analysis was performed within each age-at-onset stratum. <br \/><strong>Data Synthesis:<\/strong> Individuals with 1 risk allele at rs16969968 who were early-onset smokers were significantly more likely to be heavy smokers in adulthood (odds ratio [OR]=1.45; 95% CI, 1.36-1.55; n=13 843) than were carriers of the risk allele who were late-onset smokers (OR=1.27; 95% CI, 1.21-1.33, n=19 505) (<em>P<\/em>=.01). <br \/><strong>Conclusion:<\/strong> These results highlight an increased genetic vulnerability to smoking in early-onset smokers.",
